var RT = "/";

person_filters = {
	"hurt" : function(d,i){
		d[i+1] = Math.floor(d[i+1]*0.3);
		d[i+2] = 0;
	}
}
gold_filter = {
	"gold" : function(d,i){
		if( d[i+3] > 0 && Math.abs( (d[i] + d[i+1] + d[i+2]) - d[i]*3 ) < 6 ){
			d[i+1] = Math.floor( d[i+1]*0.9 );
			d[i+2] = Math.floor( d[i+1]*0.2 );
		}
	}
}

